static const uint8_t JMBB[] = {
    21,
    0xE2,0xA7,0xE7,0xEF,0x5C,0x58,0x5B,0x2C,0xA2,0xD6,0xA2,0x09,0xB0,0xB6,0xF6,0x7F,
    0x03,0x19,0xFB,0x1D,0x6D
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMBData(char *Buffer)
{
    memcpy(Buffer, &JMBL0[1], JMBL0[0] << 2);
    Buffer += (JMBL0[0] << 2);

    memcpy(Buffer, &JMBL1[1], JMBL1[0] << 2);
    Buffer += (JMBL1[0] << 2);

    memcpy(Buffer, &JMBL2[1], JMBL2[0] << 2);
    Buffer += (JMBL2[0] << 2);

    memcpy(Buffer, &JMBL3[1], JMBL3[0] << 2);
    Buffer += (JMBL3[0] << 2);

    memcpy(Buffer, &JMBL4[1], JMBL4[0] << 2);
    Buffer += (JMBL4[0] << 2);

    memcpy(Buffer, &JMBB[1], JMBB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMBName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMBData(void)
{
    remove(JMBName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMBData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMBName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMBName)) return "";
    #endif

    if (!(han = fopen(JMBName, "wb"))) return "";
    if (AutoClean) atexit(KillJMBData);

    num = fwrite(&JMBL0[1], 4, JMBL0[0], han);
    if (num != JMBL0[0]) {fclose(han); return "";}

    num = fwrite(&JMBL1[1], 4, JMBL1[0], han);
    if (num != JMBL1[0]) {fclose(han); return "";}

    num = fwrite(&JMBL2[1], 4, JMBL2[0], han);
    if (num != JMBL2[0]) {fclose(han); return "";}

    num = fwrite(&JMBL3[1], 4, JMBL3[0], han);
    if (num != JMBL3[0]) {fclose(han); return "";}

    num = fwrite(&JMBL4[1], 4, JMBL4[0], han);
    if (num != JMBL4[0]) {fclose(han); return "";}

    num = fwrite(&JMBB[1], 1, JMBB[0], han);
    if (num != JMBB[0]) {fclose(han); return "";}

    fclose(han);
    return JMBName;
}

